void loop() {
  // prompt the user to enter text
  Serial.println("Enter text to convert to Morse code:");

  // read the text from the user
  String text = Serial.readString();

  // convert the text to Morse code
  for (int i = 0; i < text.length(); i++) {
    char c = text.charAt(i);
    if (c >= 'A' && c <= 'Z') {
      c = c - 'A' + 'a';
    }
    if (c >= 'a' && c <= 'z') {
      int index = c - 'a';
      Serial.print(morseCode[index]);
      Serial.print(" ");
      playMorseCode(morseCode[index]);
    } else if (c == ' ') {
      Serial.print(" ");
      delay(wordSpaceDuration);
    }
  }

  // add a space between words
  Serial.println();
  delay(wordSpaceDuration);
}

void playMorseCode(const char* morseCode) {
  for (int i = 0; i < strlen(morseCode); i++) {
    if (morseCode[i] == '.') {
      tone(9, 1000, dotDuration);
      delay(spaceDuration);
    } else if (morseCode[i] == '-') {
      tone(9, 1000, dashDuration);
      delay(spaceDuration);
    }
  }
  noTone(9);
  delay(letterSpaceDuration);
}
